VALEUR = {
    'I': 1,
    'V': 5,
    'X': 10,
    'L': 50,
    'C': 100,
    'D': 500,
    'M': 1000
}


def decimale(romain):
    total = 0
    
    for i in range(len(romain)):
        if i + 1 < len(romain) and VALEUR[romain[i]] < VALEUR[romain[i + 1]]:
            total -= VALEUR[romain[i]]  
        else:
            total += VALEUR[romain[i]]  
    return total


